func beautifulIndices(s string, a string, b string, k int) []int {
    var result []int
    for i := 0; i <= len(s)-len(a); i++ {
        if s[i:i+len(a)] == a {
            for j := 0; j <= len(s)-len(b); j++ {
                if s[j:j+len(b)] == b && abs(i-j) <= k {
                    result = append(result, i)
                    break
                }
            }
        }
    }
    return result
}

func abs(x int) int {
    if x < 0 {
        return -x
    }
    return x
}
